 import product_cart from "../data/product_data";
import './mainproduct.css';
import * as React from 'react';
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import Box from '@mui/material/Box';
import './mainproduct.css';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import { CardActionArea } from '@mui/material';




const Mainproduct = () => {
  const [spacing, setSpacing] = React.useState(2);
  
    const handleChange = (event) => {
      setSpacing(Number(event.target.value));
    };
  
    const jsx = `
  <Grid container spacing={${spacing}}>
  `;
  
  

  return(
      <Grid sx={{ flexGrow: 1 ,backgroundColor:"red"}} container spacing={2}>
        <Grid item xs={17} sx={{backgroundColor:"blue"}}>
          <Grid container justifyContent="center" spacing={spacing} style={{display:"flex",flexDirection:"row",gap:"20px"}}>
            {product_cart.map((value) => (
              
              <div >
            
                      <Card sx={{ maxWidth: 500 }} >
                          <CardActionArea>
                            <CardMedia
                              component="img"
                              height="300"
                              width="250"
                              image={value.thumb}
                              alt="green iguana"
                            />
                            

                            <CardContent>
                              <Typography gutterBottom variant="h5" component="div">
                                {value.name}
                              </Typography>
                              <Typography variant="body2" color="text.secondary">
                              {value.description}

                              </Typography>
                            </CardContent>
                          </CardActionArea>
                        </Card>
                
                        </div>
              
            ))}
            
          </Grid>
        </Grid>
        
      </Grid>);
    








              


}
export default Mainproduct;
